(315, 0, '2013-03-09 00:00:00', NULL, 'Excmo. Y Rvdo. Sr. D.', NULL, NULL, '', '0000-00-00 00:00:00', 'Alfonso', 'Carrasco', NULL, 'Obispo de Lugo', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\"Mons. Alfonso Carrasco nacio el 12 de octubre de 1956 en Villalba (Lugo). Estudio Filosofia en la Pontificia Universidad de Salamanca y Teologia en Friburgo (Suiza), donde obtuvo la Licenciatura en 1980.  El 30 de noviembre de 2007 el Papa Benedicto XVI le nombro Obispo de Lugo.\"', NULL),
